import { styled } from 'styled-components';

export const ContactListStyled = styled.ul`
  height: 200px;
  overflow: auto;
  margin-top: 20px;
  padding: 5px;
`;

export const EmptyEl = styled.span`
  margin-top: 40px;
  font-size: 28px;
`;
